import React, { Component } from "react";
import { getUsers } from "../api/apiCalls";
import { withTranslation } from "react-i18next";
import "bootstrap/dist/css/bootstrap.min.css";
import UserListItem from "./UserListItem";

class UserList extends Component {
  // ... (Your existing code)

  render() {
    const { t } = this.props;
    const { content: users, last, first } = this.state.page;

    return (
      <div className="card ml-auto" style={{ marginRight: "10px" }}>
        <h3 className="card-header text-center">{t("Users")}</h3>
        <div className="list-group list-group-flush">
          {users.map((user) => (
            <UserListItem key={user.username} user={user} />
          ))}
        </div>
        <div
          className="d-flex justify-content-between"
          style={{
            margin: "4px",
          }}
        >
          {first === false && (
            <button className="btn btn-primary" onClick={this.onClickPrevious}>
              {t("Previous")}
            </button>
          )}
          {last === false && (
            <button className="btn btn-secondary" onClick={this.onClickNext}>
              {t("Next")}
            </button>
          )}
        </div>
      </div>
    );
  }
}

export default withTranslation()(UserList);
